import React from 'react';
import s from './CheckList.module.css'
const CheckList = () => {
    return (
        <div className={s.check__wrapper}>
            <label className={s.tel__wrapper}>
                Введите номер телефона
            <input type="tel" className={s.tel} /> 
            </label>
            <label className={s.sum__wrapper}>
                Введите сумму (1-1000 руб)
            <input type="text" className={s.sum} />
            </label>
            <input type="submit"/>           
        </div>
            );
        }
export default CheckList;
